import React from 'react';

import { Footer, Icon } from 'react-materialize';
import Grid from '@material-ui/core/Grid';
import logo from '../../assets/images/logo.svg';
import facebook from '../../assets/images/facebook.svg';
import linkedIn from '../../assets/images/linkedIn.svg';
import instagram from '../../assets/images/instagram.svg';


const footer = (props) => (

    <Footer
    className="example"
    copyrights="Copyright © Dronaar 2020, All Rights Reserved"
    moreLinks={<a className="grey-text text-lighten-4 right" href="#!">More Links</a>}
  >
      <Grid container>
          
          <Grid item lg={12}><Grid container>
              <Grid item lg={4} className="footerGrid">
                  <Grid container>
                      <Grid item lg={12}><img src={logo}></img></Grid>
                      <Grid item lg={12} className="footerGrid ssd"><a href="https://www.linkedin.com/company/dronaar/"><img className="footerIcon" src={linkedIn}></img></a><a href="https://www.facebook.com/dronaar/"><img className="footerIcon2"  src={facebook}></img></a><a href="https://www.instagram.com/dronaar/"><img  className="footerIcon" src={instagram}></img></a></Grid>
                  </Grid>
                  </Grid>
              <Grid item lg={4} className="footerGrid"><ul><li><a className="grey-text text-lighten-3" href="#!">Link 1</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 2</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 3</a></li><li><a className="grey-text text-lighten-3" href="#!">Link 4</a></li>
              <li><a className="grey-text text-lighten-3" href="#!">Link 5</a></li>
              <li><a className="grey-text text-lighten-3" href="#!">Link 6</a></li></ul></Grid>
              <Grid item lg={4} className="footerGrid"><h5 className="white-text">
      Footer Content
    </h5></Grid>
          </Grid></Grid>
          
      </Grid>
    
    
  </Footer>
    
    );
    
    export default footer;
